import { Box, Typography } from '@material-ui/core';
import React from 'react';

const OTP = () => {
    return (
        <Box >
            <Box textAlign="left" padding="20px">
                <Typography variant="h4" component="h4" >DayOne</Typography>
            </Box>

        </Box >
    )
}

export default OTP;
